import icon1 from '../images/icon1.png'
import headerImage from '../images/header.png'
import { Grid} from '@mui/material';

function Header() {
    return (
        <Grid display="flex">
            <img src={icon1}></img>
            <img src={headerImage}></img>
        </Grid>
      );
}

export default Header;
